import React, { useEffect, useState } from "react";
import axios from 'axios';




const Films = () => {

    const [Data, setData] = useState({
        Films: []
    })

    useEffect(() => {
        axios.get('https://www.swapi.tech/api/films/')
            .then(res => {
                let swapiData = res.data.result;
                setData({
                    // Films: swapiData.forEach(element => { console.log(element.properties.title) }) 
                    //REFACTOR*****************************
                    Films: [swapiData[0].properties.title, swapiData[1].properties.title, swapiData[2].properties.title, swapiData[3].properties.title, swapiData[4].properties.title, swapiData[5].properties.title]
                })
            })
            .catch(err => {
                console.log(err);
            })
    }, [])


    return (
        <div>
            <p>{Data.Films[1]}</p>
        </div>
    )
}
export default Films;
